import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import PerformanceApp from './PerformanceApp';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <PerformanceApp />
  </React.StrictMode>
);

PerformanceApp();
